scriptlet.script:
function getValueFromArray(arrayList, index){
	if(index < arrayList.length){
		return arrayList[i];
	} else {
		return "";
	}
}

try{
	var discountsApprovedList 		= discountsApproved.split(delimiter);
	var existingLoanAccountsList 	= existingLoanAccounts.split(delimiter);
	var productsList 				= products.split(delimiter);
	var repayTypesList 				= repayTypes.split(delimiter);
	var loanAmountsList 			= loanAmounts.split(delimiter);

	var resultObject = [];

	for (var i = 0; i < discountsApprovedList.length; i++) {
		temp = Object();
		temp.requestorName 			= brokerName;
		temp.tae					= tae;
		temp.branch 				= branch;
		temp.approvalStatus 		= approvalStatus
		temp.competitorName 		= competitorName
		temp.overallRote 			= overallRote;
		temp.rfPricingStatus 		= rfPricingStatus;
		temp.requestProductName 	= getValueFromArray(productsList, i);
		temp.discount 				= getValueFromArray(discountsApprovedList, i);
		temp.accountNumber 			= getValueFromArray(existingLoanAccountsList, i);		
		temp.repayType 				= getValueFromArray(repayTypesList, i);
		temp.loanAmount 			= getValueFromArray(loanAmountsList, i);
		//Added If condition for Defect 26016 
		if(temp.accountNumber !== "")
		{
			resultObject.push(temp)
		}
	}

	var loanDetails 	= JSON.stringify(resultObject);	
	scriptletResult 	= loanDetails;
	scriptletResponse 	= "success"; 
	scriptletContext.put("structuredArray", loanDetails);

} catch(err) {
	scriptletContext.put("errorMessage", "An Error occured while processing Loan Accounts, Exception");
	scriptletResult 	= err.message;
	scriptletResponse 	= "failure"; 
}

